webpackJsonp([0xac7a04fb4700],{842:function(t,e){t.exports={data:{markdownRemark:{html:'<h2 id="editor-integrations"><a href="#editor-integrations" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Editor Integrations</h2>\n<ul>\n<li><strong><a href="https://github.com/babel/babel-sublime">Sublime Text: babel-sublime</a>:</strong> Snippets, syntax highlighting and optimized color schemes for Sublime Text</li>\n<li><strong><a href="https://atom.io/packages/language-babel">Atom: language-babel</a></strong> Support for es2016, JSX and Flow.</li>\n<li><strong><a href="https://code.visualstudio.com/updates/vFebruary#_languages-javascript">Visual Studio Code</a></strong> Visual Studio Code supports JSX directly.</li>\n<li><strong><a href="http://www.jetbrains.com/webstorm/">JetBrains WebStorm</a>:</strong> Syntax highlighting, code completion, error detection for JSX</li>\n<li><strong><a href="https://github.com/Minwe/jetbrains-react">JetBrains IDE Live Templates</a>:</strong> React live templates for JetBrains editors (e.g. WebStorm, PHPStorm, etc.)</li>\n<li><strong><a href="https://github.com/jjeising/javascript-jsx.tmbundle">javascript-jsx.tmbundle</a></strong> Syntax for TextMate</li>\n<li><strong><a href="http://web-mode.org">web-mode.el</a>:</strong> An autonomous emacs major mode that indents and highlights JSX.  No support for Automatic Semicolon Insertion.</li>\n<li><strong><a href="https://github.com/mxw/vim-jsx">vim-jsx</a>:</strong> Syntax highlighting and indenting for JSX</li>\n</ul>\n<h2 id="build-tools"><a href="#build-tools" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Build Tools</h2>\n<ul>\n<li><strong><a href="https://github.com/facebookincubator/create-react-app">Create React App</a>:</strong> An <strong>officially supported</strong> way to create React apps with no configuration.</li>\n<li><strong><a href="https://github.com/insin/nwb">nwb</a></strong>: A toolkit for React, Preact &#x26; Inferno apps, React libraries and other npm modules for the web, with no configuration (until you need it)</li>\n<li><strong><a href="https://neutrino.js.org/">Neutrino</a></strong>: Create and build modern JavaScript applications with zero initial configuration. Neutrino combines the power of webpack with the simplicity of presets.</li>\n<li><strong><a href="http://eslint.org">ESLint</a>:</strong> A pluggable JavaScript linter that natively supports JSX syntax. Be sure to download <a href="https://npmjs.com/package/eslint-plugin-react">eslint-plugin-react</a> for React-specific rules.</li>\n<li><strong><a href="https://www.npmjs.com/package/structor">Structor</a>:</strong> This tool is a user interface builder for node.js Web applications with React UI. Structor replaces the now deprecated React UI Builder. Watch <a href="https://youtu.be/z96xYa51EWI?list=PLAcaUOtEwjoR_U6eE2HQEXwkefeVESix1">Structor Video Tutorials</a></li>\n<li><strong><a href="https://github.com/bigpipe/react-jsx">react-jsx</a>:</strong> Compile and use JSX as stand-alone templates that can run server-side and client side!</li>\n<li><strong><a href="https://github.com/jsdf/cjsx-codemod">cjsx-codemod</a>:</strong> Write JSX code within Coffeescript!</li>\n<li><strong><a href="https://github.com/1j01/react-script">ReactScript</a>:</strong> Write React code within Coffeescript without JSX!</li>\n<li><strong><a href="https://npmjs.org/package/jsxhint">jsxhint</a>:</strong> <a href="http://jshint.com/">JSHint</a> (linting) support. (JSX compilation doesn’t affect line numbers so lint can also be run directly on the compiled JS.)</li>\n<li><strong><a href="https://npmjs.org/package/reactify">reactify</a>:</strong> <a href="http://browserify.org/">Browserify</a> transform.</li>\n<li><strong><a href="https://babeljs.io/">Babel</a>:</strong> Standalone &#x26; <a href="http://browserify.org/">Browserify</a> transform (formerly known as <strong>6to5</strong>).</li>\n<li><strong><a href="https://npmjs.org/package/node-jsx">node-jsx</a>:</strong> Native <a href="http://nodejs.org/">Node</a> support.</li>\n<li><strong><a href="http://gaearon.github.io/react-hot-loader/">react-hot-loader</a>:</strong> Loader for <a href="http://webpack.github.io/">webpack</a> that lets you edit JSX and have changes appear immediately in the browser without reloading the page.</li>\n<li><strong><a href="https://npmjs.org/package/jsx-loader">jsx-loader</a>:</strong> Loader for <a href="http://webpack.github.io/">webpack</a>.</li>\n<li><strong><a href="https://www.npmjs.org/package/express-jsxtransform">express-jsxtransform</a>:</strong> Middleware for <a href="https://www.npmjs.org/package/express">Express</a>.</li>\n<li><strong><a href="https://github.com/ehirsch/gradle-react-plugin">gradle-react-plugin</a>:</strong> Transform jsx sources during a gradle build.</li>\n<li><strong><a href="https://npmjs.org/package/grunt-react">grunt-react</a>:</strong> <a href="http://gruntjs.com/">GruntJS</a> task.</li>\n<li><strong><a href="https://npmjs.org/package/gulp-react">gulp-react</a>:</strong> <a href="http://gulpjs.com/">GulpJS</a> plugin.</li>\n<li><strong><a href="https://www.npmjs.org/package/react-brunch">brunch-react</a>:</strong> <a href="http://brunch.io/">Brunch</a> plugin.</li>\n<li><strong><a href="https://github.com/philix/jsx-requirejs-plugin">jsx-requirejs-plugin</a>:</strong> <a href="http://requirejs.org/">RequireJS</a> plugin.</li>\n<li><strong><a href="https://github.com/benjamn/react-meteor">react-meteor</a>:</strong> <a href="http://www.meteor.com/">Meteor</a> plugin.</li>\n<li><strong><a href="https://github.com/facebook/react-python">pyReact</a>:</strong> <a href="http://www.python.org/">Python</a> bridge to JSX.</li>\n<li><strong><a href="https://github.com/facebook/react-rails">react-rails</a>:</strong> Ruby gem for using JSX with <a href="http://rubyonrails.org/">Ruby on Rails</a>.</li>\n<li><strong><a href="https://github.com/talyssonoc/react-laravel">react-laravel</a>:</strong> PHP package for using ReactJS with <a href="http://laravel.com/">Laravel</a>.</li>\n<li><strong><a href="http://reactjs.net/">ReactJS.NET</a>:</strong> .NET library for React and JSX.</li>\n<li><strong><a href="https://github.com/ddispaltro/sbt-reactjs">sbt-reactjs</a></strong> SBT/Play/Scala JSX compiler plugin</li>\n<li><strong><a href="https://github.com/dbashford/mimosa-react">mimosa-react</a>:</strong> <a href="http://mimosa.io">Mimosa</a> plugin.</li>\n<li><strong><a href="https://github.com/peh/react-grails-asset-pipeline">react-grails-asset-pipeline</a>:</strong> Assets for react and precompilation of jsx files in <a href="http://grails.org/">Grails</a>.</li>\n<li><strong><a href="https://github.com/goreutils/gore-gulp">gore-gulp</a>:</strong> Wrapper around <a href="https://webpack.github.io/">webpack</a>, <a href="http://eslint.org/">eslint</a>, <a href="https://mochajs.org/">mocha</a> for ease of use and zero configuration.</li>\n<li><strong><a href="https://github.com/webpack/webpack">webpack</a>:</strong> Packs CommonJs/AMD modules for the browser. Allows to split your codebase into multiple bundles, which can be loaded on demand. Support loaders to preprocess files, i.e. json, jade, coffee, css, less, … and your custom stuff.</li>\n<li><strong><a href="https://github.com/wenbing/webpack-bbq">webpack-bbq</a>:</strong> transform your src to lib, supports server rendering and static rendering.</li>\n<li><strong><a href="https://github.com/cronn-de/jsxtransformer">jsxtransformer</a>:</strong> Compile pipeline for jsx files in Java</li>\n<li><strong><a href="https://github.com/marionebl/babylon-jsx">babylon-jsx</a></strong>: Transform JSX to ES2015 with babylon sans babel</li>\n<li><strong><a href="https://github.com/antonybudianto/cra-universal">CRA Universal CLI</a></strong> - A simple CLI to create and build Express server for your create-react-app projects, featuring Server-side rendering and Code-splitting.</li>\n</ul>',frontmatter:{title:"JSX Integrations",next:null,prev:null},fields:{path:"community/tools-jsx.md",slug:"community/jsx-integrations.html"}}},pathContext:{slug:"community/jsx-integrations.html"}}}});
